import React, { Component } from 'react';
import './App.css';
import {Route, Link} from "react-router-dom"
import axios from 'axios'
import Home from "./components/Home-Page/Intro"
// import Articles from "./components/Articles-Page/Articles"
// import FoodTracker from "./components/Food-Tracker-Page/FoodContent"
// import Profile from "./components/Profile-Page/Personal"

// import FoodTracker from "./components/Food-Tracker-Page/FoodSearch"
// import Profile from "./components/Profile-Page/HealthProfile"

const apiKey = process.env.REACT_APP_USDA_DATABASE_API_KEY;
const nutrients = "nutrient=2";
console.log(apiKey);
class App extends Component {
  constructor() {
    super()
    this.state = {

    }
  }

  componentDidMount() {
    fetch(`https://api.nal.usda.gov/ndb/nutrients/?format=xml&api_key=${apiKey}&nutrients=203&nutrients=204&nutrients=208&nutrients=205`)
      .then(response => response.json())
      .then(data => {
        console.log(data);
      })
  }


  render() {
    return (
      <div className="App">
        <h1>Hello World</h1>

        <nav>
          <ul>
            {/* <li><Link to="/">Home</Link></li> */}
            {/* <li><Link to="/articles">Articles</Link></li>
            <li><Link to="/food-tracker">FoodTracker</Link></li>
            <li><Link to="/profile">Profile</Link></li> */}
          </ul>
        </nav>

        <main>
          {/* <Route exact path="/" component={Home}></Route> */}
          {/* <Route path="/about" component={Articles}></Route>
          <Route path="/food-tracker" component={FoodTracker}></Route>
          <Route path="/profile" component={Profile}></Route> */}
        </main>

      </div>
    );
  }
}

export default App;
